import React from 'react';

function Contact() {
  return React.createElement(
    'section',
    { id: 'contact', className: 'p-8 text-center' },
    React.createElement('h2', { className: 'text-2xl font-bold mb-4' }, 'Contact Me'),
    React.createElement('p', null, 'Email: your.email@example.com'),
    React.createElement('p', null, 'GitHub: github.com/yourusername'),
    React.createElement('p', null, 'LinkedIn: linkedin.com/in/yourusername')
  );
}

function Projects() {
  return React.createElement(
    'section',
    { id: 'projects', className: 'p-8' },
    React.createElement('h2', { className: 'text-2xl font-bold mb-4' }, 'Projects'),
    React.createElement(
      'div',
      { className: 'grid gap-6 sm:grid-cols-2' },
      React.createElement(
        'div',
        { className: 'p-4 border rounded shadow' },
        React.createElement('h3', { className: 'font-semibold' }, 'Dish Craft'),
        React.createElement('p', { className: 'text-sm' }, 'A social cooking platform using MERN stack'),
        React.createElement(
          'a',
          { href: 'https://github.com/yourusername/dishcraft', className: 'text-blue-500' },
          'GitHub'
        )
      )
    )
  );
}

export { Contact, Projects };
